-- seed data from mockaroo, see model.js for conversion to sequelize
drop database if exists airbenderReviews;

create database airbenderReviews;

use airbenderReviews;

create table airbenderMock (
	id MEDIUMINT AUTO_INCREMENT NOT NULL,
	finalStar INT NOT NULL,
	accuracyStar INT NOT NULL,
	locationStar INT NOT NULL,
	checkinStar INT NOT NULL,
	cleanlinessStar INT NOT NULL,
	valueStar INT NOT NULL,
	communicationStar INT NOT NULL,
	userId NOT NULL INT AUTO_INCREMENT,
	userName VARCHAR(50) NOT NULL,
	reviewContent TEXT NOT NULL,
	createdAt DATE NOT NULL,
	productId INT, 
	PRIMARY KEY(id)
);
